import logo from "../../img/687abebf7d05bc6f1a807ae8ccf81c63 1.png"

function Header() {
    return(<div className="container">
        <div className="header"><p className="heading">Rayal Park</p>
            <img src={logo} className="logo" />

        </div>
    </div>
    );
}

export default Header
